import React from "react";
import { Switch } from "react-router";
import "./App.css";

function App() {
  return (
    <>
      <Router>
        <Switch>
          <Route path="/" component={Home} />
          <Route path="./pages/Login" component={Login} />
          <Route path="./pages/Register" component={Register} />
        </Switch>
      </Router>
    </>
  );
}

export default App;
